PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "daily_weather" (
"Formatted Date" TEXT,
  "Temperature (C)" REAL,
  "Apparent Temperature (C)" REAL,
  "Humidity" REAL,
  "Wind Speed (km/h)" REAL,
  "Wind Bearing (degrees)" REAL,
  "Visibility (km)" REAL,
  "Loud Cover" REAL,
  "Pressure (millibars)" REAL,
  "wind_strength" TEXT
);
CREATE TABLE IF NOT EXISTS "monthly_weather" (
"Formatted Date" TEXT,
  "Temperature (C)" REAL,
  "Apparent Temperature (C)" REAL,
  "Humidity" REAL,
  "Wind Speed (km/h)" REAL,
  "Wind Bearing (degrees)" REAL,
  "Visibility (km)" REAL,
  "Loud Cover" REAL,
  "Pressure (millibars)" REAL,
  "month" TEXT,
  "mode_precip_type" TEXT
);
COMMIT;
